import React, { Component } from 'react';
import SideNav from 'react-simple-sidenav';
class Header extends Component {
    render(){
    return ( <header>
        import SideNav from 'react-simple-sidenav';
 
 <SideNav
   title="Simple Sidenav"
   items={['Item 1', 'Item 2']}
   />
    </header>)
    }
}

export default Header;
